import React from 'react';

export default function MetaBar({ meta }) {
  if (!meta) return null;
  return (
    <div className="meta-bar">
      <span>Model ts: {meta.model_timestamp}</span>
      <span>Features: {meta.n_features}</span>
      <span>Classes: {meta.n_classes}</span>
    </div>
  );
}
